import Link from 'next/link';

const Footer = () => (
  <div>
  	<p>Copyright Â© 2011-2019 Litecoin Project. All rights reserved.</p>
    <Link href="/">
      <a>  	<img src={'https://i.pinimg.com/originals/27/d5/42/27d542e2e2626de4c08ee3d84aaabb7b.png'} alt="" /></a>
    </Link>

    <Link href="/">
      <a>  	<img src={'https://cdn3.iconfinder.com/data/icons/picons-social/57/43-twitter-512.png'} alt="" /></a>
    </Link>

    <Link href="/">
      <a>  	<img src={'https://www.pngkey.com/png/detail/0-8475_reddit-social-logo-character-reddit-icon-png.png'} alt="" /></a>
    </Link>
      <style jsx>{`
      	div {
      		height: 50px;
      		background-color: white;
      		text-align: center;
      		padding-top: 30px;
      	}

        a {
        	margin-right: 25px;
        	text-decoration: none;

        }

        img {
        	height:100px;
        	width:100px;

        }

      `}</style>
  </div>



);

export default Footer;
